size=\"150\"]\n\n<p style=\"text-align: center;\">Sản phẩm thực phẩm chức năng của chúng tôi là các sản phẩm tốt cho sức khỏe</p>\n[gap height=\"10px\"]\n\n[ux_products style=\"normal\" slider_nav_style=\"simple\" slider_nav_color=\"light\" slider_nav_position=\"outside\" image_height=\"105%\" image_size=\"original\" image_overlay=\"rgba(255, 255, 255, 0.28)\" image_hover=\"overlay-add\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Tin tức\" class=\"tin-tuc\" bg_color=\"rgb(243, 243, 243)\"]\n\n[row]\n\n[col span=\"8\" span__sm=\"12\" class=\"cot8\"]\n\n[title style=\"center\" text=\"TIN TỨC - BÍ QUYẾT LÀM ĐẸP\" color=\"rgb(69, 0, 0)\" size=\"125\"]\n\n[gap height=\"18px\"]\n\n[blog_posts style=\"vertical\" type=\"row\" col_spacing=\"small\" columns=\"1\" columns__md=\"1\" posts=\"5\" show_date=\"text\" excerpt_length=\"41\" comments=\"false\" image_height=\"78%\" image_width=\"30\" image_size=\"original\" image_overlay=\"rgba(255, 255, 255, 0.28)\" image_hover=\"overlay-add\" text_pos=\"middle\" text_align=\"left\"]\n\n\n[/col]\n[col span=\"4\" span__sm=\"12\" class=\"cot4\"]\n\n[contact-form-7 id=\"244\"]\n\n[ux_video url=\"https://youtu.be/3LYvsS42v88\" height=\"50%\"]\n\n[ux_image id=\"550\"]\n\n\n[/col]\n\n[/row]\n\n[/section]','Trang chủ','','publish','closed','open','','trang-chu','','','2019-03-27 23:48:19','2019-03-27 16:48:19','',0,'http://matong.khowebseotop.vn/?page_id=2',0,'page','',0),(3,2,'2019-01-15 12:24:48','2019-01-15 12:24:48','<h2>Chúng tôi là ai</h2><p>Địa chỉ website là: http://matong.khowebseotop.vn.</p><h2>Thông tin cá nhân nào bị thu thập và tại sao thu thập</h2><h3>Bình luận</h3><p>Khi khách truy cập để lại bình luận trên trang web, chúng tôi thu thập dữ liệu được hiển thị trong biểu mẫu bình luận và cũng là địa chỉ IP của người truy cập và chuỗi user agent của người dùng trình duyệt để giúp phát hiện spam</p><p>Một chuỗi ẩn danh được tạo từ địa chỉ email của bạn (còn được gọi là hash) có thể được cung cấp cho dịch vụ Gravatar để xem bạn có đang sử dụng nó hay không. Chính sách bảo mật của dịch vụ Gravatar có tại đây: https://automattic.com/privacy/. Sau khi chấp nhận bình luận của bạn, ảnh tiểu sử của bạn được hiển thị công khai trong ngữ cảnh bình luận của bạn.</p><h3>Thư viện</h3><p>Nếu bạn tải hình ảnh lên trang web, bạn nên tránh tải lên hình ảnh có dữ liệu vị trí được nhúng (EXIF GPS) đi kèm. Khách truy cập vào trang web có thể tải xuống và giải nén bất kỳ dữ liệu vị trí nào từ hình ảnh trên trang web.</p><h3>Thông tin liên hệ</h3><h3>Cookies</h3><p>Nếu bạn viết bình luận trong website, bạn có thể cung cấp cần nhập tên, email địa chỉ website trong cookie. Các thông tin này nhằm giúp bạn không cần nhập thông tin nhiều lần khi viết bình luận khác. Cookie này sẽ được lưu giữ trong một năm.</p><p>Nếu bạn có tài khoản và đăng nhập và website, chúng tôi sẽ thiết lập một cookie tạm thời để xác định nếu trình duyệt cho phép sử dụng cookie. Cookie này không bao gồm thông tin cá nhân và sẽ được gỡ bỏ khi bạn đóng trình duyệt.</p><p>Khi bạn đăng nhập, chúng tôi sẽ thiết lập một vài cookie để lưu thông tin đăng nhập và lựa chọn hiển thị. Thông tin đăng nhập gần nhất lưu trong hai ngày, và lựa chọn hiển thị gần nhất lưu trong một năm. Nếu bạn chọn &quot;Nhớ tôi&quot;, thông tin đăng nhập sẽ được lưu trong hai tuần. Nếu bạn thoát tài khoản, thông tin cookie đăng nhập sẽ bị xoá.</p><p>Nếu bạn sửa hoặc công bố bài viết, một bản cookie bổ sung sẽ được lưu trong trình duyệt. Cookie này không chứa thông tin cá nhân và chỉ đơn giản bao gồm ID của bài viết bạn đã sửa. Nó tự động hết hạn sau 1 ngày.</p><h3>Nội dung nhúng từ website khác</h3><p>Các bài viết trên trang web này có thể bao gồm nội dung được nhúng (ví dụ: video, hình ảnh, bài viết, v.v.). Nội dung được nhúng từ các trang web khác hoạt động theo cùng một cách chính xác như khi khách truy cập đã truy cập trang web khác.</p><p>Những website này có thể thu thập dữ liệu về bạn, sử dụng cookie, nhúng các trình theo dõi của bên thứ ba và giám sát tương tác của bạn với nội dung được nhúng đó, bao gồm theo dõi tương tác của bạn với nội dung được nhúng nếu bạn có tài khoản và đã đăng nhập vào trang web đó.</p><h3>Phân tích</h3><h2>Chúng tôi chia sẻ dữ liệu của bạn với ai</h2><h2>Dữ liệu của bạn tồn tại bao lâu</h2><p>Nếu bạn để lại bình luận, bình luận và siêu dữ liệu của nó sẽ được giữ lại vô thời hạn. Điều này là để chúng tôi có thể tự động nhận ra và chấp nhận bất kỳ bình luận nào thay vì giữ chúng trong khu vực đợi kiểm duyệt.</p><p>Đối với người dùng đăng ký trên trang web của chúng tôi (nếu có), chúng tôi cũng lưu trữ thông tin cá nhân mà họ cung cấp trong hồ sơ người dùng của họ. Tất cả người dùng có thể xem, chỉnh sửa hoặc xóa thông tin cá nhân của họ bất kỳ lúc nào (ngoại trừ họ không thể thay đổi tên người dùng của họ). Quản trị viên trang web cũng có thể xem và chỉnh sửa thông tin đó.</p><h2>Các quyền nào của bạn với dữ liệu của mình</h2><p>Nếu bạn có tài khoản trên trang web này hoặc đã để lại nhận xét, bạn có thể yêu cầu nhận tệp xuất dữ liệu cá nhân mà chúng tôi lưu giữ về bạn, bao gồm mọi dữ liệu bạn đã cung cấp cho chúng tôi. Bạn cũng có thể yêu cầu chúng tôi xóa mọi dữ liệu cá nhân mà chúng tôi lưu giữ về bạn. Điều này không bao gồm bất kỳ dữ liệu nào chúng tôi có nghĩa vụ giữ cho các mục đích hành chính, pháp lý hoặc bảo mật.</p><h2>Các dữ liệu của bạn được gửi tới đâu</h2><p>Các bình luận của khách (không phải là thành viên) có thể được kiểm tra thông qua dịch vụ tự động phát hiện spam.</p><h2>Thông tin liên hệ của bạn</h2><h2>Thông tin bổ sung</h2><h3>Cách chúng tôi bảo vệ dữ liệu của bạn</h3><h3>Các quá trình tiết lộ dữ liệu mà chúng tôi thực hiện</h3><h3>Những bên thứ ba chúng tôi nhận dữ liệu từ đó</h3><h3>Việc quyết định và/hoặc thu thập thông tin tự động mà chúng tôi áp dụng với dữ liệu người dùng</h3><h3>Các yêu cầu công bố thông tin được quản lý</h3>','Chính sách bảo mật','','draft','closed','open','','chinh-sach-bao-mat','','','2019-01-15 12:24:48','2019-01-15 12:24:48','',0,'http://matong.khowebseotop.vn/?page_id=3',0,'page','',0),(18,2,'2019-01-15 21:08:40','2019-01-15 14:08:40','http://matong.khowebseotop.vn/wp-content/uploads/2019/01/cropped-logo.jpg','cropped-logo.jpg','','inherit','open','closed','','cropped-logo-jpg','','','2019-01-15 21:08:40','2019-01-15 14:08:40','',0,'http://matong.khowebseotop.vn/wp-content/uploads/2019/01/cropped-logo.jpg',0,'attachment','image/jpeg',0),(21,2,'2019-01-15 21:10:14','2019-01-15 14:10:14','[ux_banner height=\"23%\" bg=\"98\" bg_size=\"original\"]\n\n[text_box width=\"30\" width__sm=\"60\" position_x=\"5\" position_y=\"50\"]\n\n[contact-form-7 id=\"244\"]\n\n\n[/text_box]\n\n[/ux_banner]\n[row]\n\n[col span=\"7\" span__sm=\"12\"]\n\n<h1><strong>G</strong><strong>iấy chứng nhận các sản phẩm của Trường Thọ :</strong></h1>\n<h3>Bằng sự tâm huyết, nổ lực không ngừng nhằm tạo ra những sản phẩm mật ong chất lượng cho thị trường, thương hiệu đã được thị trường tiếp nhận và đánh giá cao, các Tổ chức uy tín cũng dánh cho công ty sự ghi nhận qua các chứng nhận</h3>\n<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat.</p>\n\n[/col]\n[col span=\"5\" span__sm=\"12\"]\n\n[ux_image id=\"235\" image_size=\"original\"]\n\n\n[/col]\n\n[/row]\n[row style=\"small\"]\n\n[col span=\"3\" span__sm=\"6\"]\n\n[ux_image id=\"446\" image_size=\"original\" height=\"147%\" lightbox=\"true\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"6\"]\n\n[ux_image id=\"448\" image_size=\"original\" height=\"147%\" lightbox=\"true\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"6\"]\n\n[ux_image id=\"447\" height=\"147%\" lightbox=\"true\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"6\"]\n\n[ux_image id=\"446\" image_size=\"original\" height=\"147%\"]\n\n\n[/col]\n\n[/row]\n[section bg_color=\"rgb(255, 255, 255)\"]\n\n[row]\n\n[col span=\"6\" span__sm=\"12\"]\n\n[gap height=\"49px\"]\n\n<h1><strong>VỀ CHÚNG TÔI</strong></h1>\n<p>Công ty cổ phần thực phẩm dinh dưỡng Trường Thọ là Công ty chuyên khai thác, sản xuất, kinh doanh, xuất khẩu từ ong. Được thành lập từ năm 2012. Trường Thọ cam kết chất lượng mật ong thiên nhiên không qua pha chế. </p>\n<p>Mật ong Trường Thọ sẽ mang đến khách hàng một sản phẩm chất lượng, một thương hiệu đáng tin cậy. Công ty Trường Thọ mong muốn có cơ hội được phục vụ quý khách và góp phần phát triền ngành ong mật Việt Nam.</p>\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[ux_image id=\"175\" image_size=\"original\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section bg_color=\"rgb(253, 194, 21)\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n[title style=\"center\" text=\"VÌ SAO CHỌN MẬT ONG CỦA CHÚNG TÔI\" color=\"rgb(72, 1, 1)\" size=\"130\"]\n\n[gap height=\"11px\"]\n\n<p style=\"text-align: center;\">Mật ong Trường Thọ luôn mang hương vị của thiên nhiên từ  hoa của cây rừng tràm, hoa nhãn, hoa cà phê,…. giàu chất dinh dưỡng sẽ mang lại cho quý khách hàng nhiều lợi ích về sức khỏe lẫn sắc đẹp. Vì vậy, kính mong quý khách hàng hãy lựa chọn Trường Thọ để trải nghiệm dòng mật ong thiên nhiên của chúng tôi</p>\n\n[/col]\n\n[/row]\n[row]\n\n[col span=\"4\" span__sm=\"12\"]\n\n[featured_box img=\"474\" img_width=\"205\" pos=\"center\"]\n\n<h4 style=\"text-align: center;\">HƯƠNG VỊ NGON NHẤT</h4>\n<p style=\"text-align: center;\"><span style=\"font-size: 95%;\">Ong rừng cho ra mật có độ ngọt vừa phải, hương thơm từ hoa rừng. Có mùi vị đặc trưng của hoa tràm, cà phê, nhãn, chôm chôm,..</span></p>\n\n[/featured_box]\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[featured_box img=\"476\" img_width=\"205\" pos=\"center\"]\n\n<h4 style=\"text-align: center;\">TINH LỌC KĨ LƯỠNG</h4>\n<p style=\"text-align: center;\"><span style=\"font-size: 90%;\"> Khép kín và kiểm tra nghiêm ngặt trong sản xuất cùng với vùng nguyên liệu rộng khắp các từ rừng U Minh đến rừng Tây Nguyên</span></p>\n\n[/featured_box]\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[featured_box img=\"479\" img_width=\"205\" pos=\"center\"]\n\n<h4 style=\"text-align: center;\"><span style=\"font-size: 90%;\">GIÁ CẢ HỢP LÝ</span></h4>\n<p style=\"text-align: center;\"><span style=\"font-size: 90%;\">Sản phẩm chất lượng nhưng chúng tôi luôn hướng đến khách hàng với mức giá ưu đãi và hợp lý nhất</span></p>\n\n[/featured_box]\n\n[/col]\n\n[/row]\n\n[/section]\n[section]\n\n[row]\n\n[col span__sm=\"12\"]\n\n[ux_gallery ids=\"235,234,233,202,200,197,196,191,87,89,98,175\" style=\"none\" col_spacing=\"small\" image_height=\"100%\" image_size=\"original\" image_overlay=\"rgba(0, 0, 0, 0.29)\" image_hover=\"overlay-add\"]\n\n\n[/col]\n\n[/row]\n\n[/section]','Giới thiệu','','publish','closed','closed','','gioi-thieu','','','2019-01-16 17:43:35','2019-01-16 10:43:35','',0,'http://matong.khowebseotop.vn/?page_id=21',0,'page','',0),(23,2,'2019-01-15 21:10:20','2019-01-15 14:10:20','<!-- wp:html -->\n<p><iframe style=\"border: 0;\" src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d14900.931775031808!2d105.79967699999999!3d20.9832975!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x4fc1c256d7cdb4d!2zR2l1c2VBcnQgLSBUaGnhur90IGvhur8gxJHhu5MgaOG7jWEgdsOgIHdlYnNpdGUgY2h1ecOqbiBuZ2hp4buHcA!5e0!3m2!1svi!2s!4v1547449390298\" width=\"100%\" height=\"350\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n[gap height=\"22px\"]\n\n[row class=\"lien-he\"]\n\n[col span=\"6\" span__sm=\"12\"]\n\n<h3><span style=\"color: #4f3716;\">LIÊN HỆ VỚI CHÚNG TÔI</span></h3>\n<p><span style=\"font-size: 100%;\"><strong>Công ty TNHH GiuseBee - Chi nhánh Hà Nội</strong></span></p>\n<ul>\n<li><span style=\"font-size: 100%;\"><strong>Trụ sở chính:</strong> Phạm Văn Bạch, P. 15, Q. Tân Bình, Tp. HCM</span></li>\n<li><span style=\"font-size: 100%;\"><strong style=\"color: #555555;\">Chi nhánh:</strong><span style=\"color: #555555;\"> Phạm Văn Bạch, P. 15, Q. Tân Bình, Tp. HCM</span></span></li>\n<li class=\"gap-element\"><span style=\"font-size: 100%;\"><strong style=\"color: #555555;\">Hotline:</strong><span style=\"color: #555555;\"> 0999