số tác dụng cơ bản trong hàng trăm tác dụng của việc này:\r\n\r\n–         Rửa sạch men axit trong dạ dày, giúp hệ tiêu hóa khỏe mạnh.\r\n\r\n–         Giảm cân, tiêu mỡ thừa và duy trì vóc dáng săn chắc.\r\n\r\n–         Giúp phòng chống ung thư.\r\n\r\n–         Phòng ngừa sâu răng, cho răng chắc khỏe và trắng sáng.\r\n\r\n–         Da dẻ mịn màng, chống lão hóa.\r\n\r\nGiờ còn điều gì ngăn bạn thực hiện thói quen này hàng ngày nhỉ? Hãy tập thói quen uống mật ong vào buổi sáng luôn đi nhé','Mật ong rừng Đà lạt loại 2 lit/chai','Làm đẹp: trị mụng, trắng da, trị bỏng, làm mờ rạn da, nở ngực, giảm cân…\r\n\r\nChữa bệnh: chữa dạ dày, chữa ho, bồi bổ cơ thể, tụt huyết áp, phòng chống bệnh , tăng sức đề kháng…\r\n\r\nNấu nướng: làm các món thịt nướng, bánh nướng…','publish','open','closed','','mat-ong-rung-da-lat-loai-2-lit-chai','','','2019-01-15 23:47:31','2019-01-15 16:47:31','',0,'http://matong.khowebseotop.vn/?post_type=product&#038;p=190',0,'product','',0),(191,2,'2019-01-15 23:47:15','2019-01-15 16:47:15','','sp2','','inherit','open','closed','','sp2','','','2019-01-15 23:47:15','2019-01-15 16:47:15','',190,'http://matong.khowebseotop.vn/wp-content/uploads/2019/01/sp2.jpg',0,'attachment','image/jpeg',0),(195,2,'2019-01-15 23:52:10','2019-01-15 16:52:10','<h2><span style=\"font-family: Helvetica;\">1. Sáp Ong Là Gì?</span></h2>\r\n<span style=\"font-family: Helvetica;\">Sáp ong là chất do ong mật thu lượm từ rất nhiều loại thực vật ừ thiên nhiên mang về hòa trộn, kết hợp lại với nhau thành một dạng chất keo tạo nên sự kết dính để tiến hành xây tổ của chúng.</span>\r\n\r\n<span style=\"font-family: Helvetica;\">Bên cạnh đó, trong quá trình hòa trộn chúng sẽ tiết ra một số loại chất giúp ngăn chặn côn trùng bên ngoài xâm nhập tổ ong và đặc biệt nó còn đóng vai trò như một kháng sinh tự nhiến giúp ngăn chăn các loại nấm mốc, vi khuẩn có thể hình thành.</span>\r\n<h2><span style=\"font-family: Helvetica;\">2. Cách Nhận Biết Sáp Ong Nguyên Chất</span></h2>\r\n<span style=\"font-family: Helvetica;\">Sáp ong nguyên chất thường có màu vàng hoặc màu trắng đục tùy thuộc vào vùng hoa và thời điểm xây dựng tổ của loài ong.</span>\r\n<h2><span style=\"font-family: Helvetica;\">3.  Có Mấy Loại Sáp Ong Thiên Nhiên Nguyên Chất.\r\n</span></h2>\r\n<span style=\"font-family: Helvetica;\">Hiện nay, có 2 loại sáp ong thiên nhiên nguyên chất như sau:</span>\r\n<ul>\r\n 	<li><span style=\"font-family: Helvetica;\">Sáp ong thô:</span></li>\r\n</ul>\r\n<span style=\"font-family: Helvetica;\">Là loại sáp sau khi quay mật xong tiến hành lấy sáp mang đi nấu và cô đặc lại. Loại sáp này thường còn nhiều loại tạp chất khác trong quá trình quay mật chưa được làm sạch như: xác ong, nhộng ong, lá cây,...</span>\r\n<h2><span style=\"font-family: Helvetica;\">4. Sáp Ong Thiên Nhiên Nguyên Chất Bán Ở Đâu?</span></h2>\r\n<span style=\"font-family: Helvetica;\">Hiện nay, Công ty Hilobee cung cấp cả 2 loại sáp ong với số lượng lớn trên toàn quốc và xuất khẩu đi các nước. </span>\r\n\r\n<span style=\"font-family: Helvetica;\">Đặc biệt, Hilobee sẽ miễn phí giao hàng cho các Khách hàng tại khu vực TP Hồ Chí Minh, các tỉnh thành khác hỗ trợ 50% chi phí giao hàng tận nơi.</span>','Sáp ong thiên nhiên nguyên chất','<span style=\"font-family: Helvetica;\">Sáp ong là chất do ong mật thu lượm từ rất nhiều loại thực vật ừ thiên nhiên mang về hòa trộn, kết hợp lại với nhau thành một dạng chất keo tạo nên sự kết dính để tiến hành xây tổ của chúng.</span>\r\n\r\n<span style=\"font-family: Helvetica;\">Bên cạnh đó, trong quá trình hòa trộn chúng sẽ tiết ra một số loại chất giúp ngăn chặn côn trùng bên ngoài xâm nhập tổ ong và đặc biệt nó còn đóng vai trò như một kháng sinh tự nhiến giúp ngăn chăn các loại nấm mốc, vi khuẩn có thể hình thành.</span>','publish','open','closed','','sap-ong-thien-nhien-nguyen-chat','','','2019-01-15 23:52:10','2019-01-15 16:52:10','',0,'http://matong.khowebseotop.vn/?post_type=product&#038;p=195',0,'product','',0),(196,2,'2019-01-15 23:51:26','2019-01-15 16:51:26','','cong-dung-cua-sap-ong','','inherit','open','closed','','cong-dung-cua-sap-ong','','','2019-01-15 23:51:26','2019-01-15 16:51:26','',195,'http://matong.khowebseotop.vn/wp-content/uploads/2019/01/cong-dung-cua-sap-ong.jpg',0,'attachment','image/jpeg',0),(197,2,'2019-01-15 23:51:56','2019-01-15 16:51:56','','nhung-cong-dung-bat-ngo-tu-sap-ong-mang-lai-cho-lan-da-cua-ban-71fd45','','inherit','open','closed','','nhung-cong-dung-bat-ngo-tu-sap-ong-mang-lai-cho-lan-da-cua-ban-71fd45','','','2019-01-15 23:51:56','2019-01-15 16:51:56','',195,'http://matong.khowebseotop.vn/wp-content/uploads/2019/01/nhung-cong-dung-bat-ngo-tu-sap-ong-mang-lai-cho-lan-da-cua-ban-71fd45.jpg',0,'attachment','image/jpeg',0),(198,2,'2019-01-15 23:53:41','2019-01-15 16:53:41','<span style=\"font-family: Helvetica;\">Vào những dịp lễ tết cũng là dịp để chúng ta thể hiện sự quan tâm đến những người thân, đối tác, nhân viên, đồng nghiệp...những người đã cùng nhau gắn bó và nổ lực không ngừng trong 1 năm qua.</span>\r\n\r\n<span style=\"font-family: Helvetica;\">Nhưng để chọn lựa được cho mình món quà đủ sang trọng, vừa thể hiện được sự quan tâm, vừa thể hiện được lòng yêu mến của mình đối với người tặng là một điều không phải ai cũng đủ tinh tế và có được sự lựa chọn tốt nhất.</span>\r\n\r\n<span style=\"font-family: Helvetica;\">Thấu hiệu được khó khăn đó, Hilobee xin giới thiệu các combo quà tặng đã được rất nhiều đối tác lựa chọn:</span>\r\n\r\n<span style=\"font-family: Helvetica;\">- Với sự đảm bảo về chất lượng sản phẩm giúp cho người được nhận hoàn toàn yên tâm sử dụng</span>\r\n\r\n<span style=\"font-family: Helvetica;\">- Thiết kế sang trọng và bắt mắt những người được nhận quà sẽ cảm thấy vô cùng thích thú và yêu quý.</span>\r\n\r\n<span style=\"font-family: Helvetica;\">- Và đặc biệt các gói Combo kết hợp với nhau có giá cả hợp lý và rất dễ dàng để lựa chọn.</span>\r\n\r\n<span style=\"font-family: Helvetica;\">- Tin chắc rằng những ai nhận được món quà này từ bạn họ sẽ cảm nhận được sự quan tâm thực sự đến từ người tặng.</span>\r\n\r\n<span style=\"font-family: Helvetica;\">Xin hãy kéo xuống dưới để cùng xem và lựa chọn cho mình nhé!</span>','Quà tặng mật ong Hilobee 2019','<span style=\"font-family: Helvetica;\">- Và đặc biệt các gói Combo kết hợp với nhau có giá cả hợp lý và rất dễ dàng để lựa chọn.</span>\r\n\r\n<span style=\"font-family: Helvetica;\">- Tin chắc rằng những ai nhận được món quà này từ bạn họ sẽ cảm nhận được sự quan tâm thực sự đến từ người tặng.</span>\r\n\r\n<span style=\"font-family: Helvetica;\">Xin hãy kéo xuống dưới để cùng xem và lựa chọn cho mình nhé!</span>','publish','open','closed','','qua-tang-mat-ong-hilobee-2019','','','2019-01-15 23:54:10','2019-01-15 16:54:10','',0,'http://matong.khowebseotop.vn/?post_type=product&#038;p=198',0,'product','',0),(199,2,'2019-01-15 23:53:33','2019-01-15 16:53:33','','mat-ong-nguyen-chat-160-ml-vihoney','','inherit','open','closed','','mat-ong-nguyen-chat-160-ml-vihoney','','','2019-01-15 23:53:33','2019-01-15 16:53:33','',198,'http://matong.khowebseotop.vn/wp-content/uploads/2019/01/mat-ong-nguyen-chat-160-ml-vihoney.jpg',0,'attachment','image/jpeg',0),(200,2,'2019-01-15 23:54:06','2019-01-15 16:54:06','','FOREVER-Bee-Honey-–-MẬT-ONG-NGUYÊN-CHẤT-Anh-Thi-Shop2','','inherit','open','closed','','forever-bee-honey-mat-ong-nguyen-chat-anh-thi-shop2','','','2019-01-15 23:54:06','2019-01-15 16:54:06','',198,'http://matong.khowebseotop.vn/wp-content/uploads/2019/01/FOREVER-Bee-Honey-–-MẬT-ONG-NGUYÊN-CHẤT-Anh-Thi-Shop2.jpg',0,'attachment','image/jpeg',0),(201,2,'2019-01-15 23:55:02','2019-01-15 16:55:02','<div><span style=\"font-family: Helvetica;\">Vào tháng 03 hàng năm tại các khu vực miền tây và miền bắc nước ta là thời điểm những trang trại nhãn bắt đầu nở hoa đây cũng là thời điềm những nhà nuôi ong ở các nơi sẽ tiến hành di chuyển đàn ong đến thu hoạch mật ong hoa nhãn. Các chú ong khi được đưa đến đây sẽ làm việc chăm chỉ ngày đêm. Ban ngày đi hút mật đưa về tổ, ban đêm tiến hành luyện mật qua một quá trình dài. Khi mật đủ chín, chủ trại nuôi ong của Hilobee mới tiến hành quay lấy mật. Đặc thù hoa nhãn có hương vị rất đặc trưng và dễ nhận biết.</span></div>\r\n<div><img src=\"https://hilobee.vn/medias/uploads/0/570-mua-mat-ong-hoa-nhan-nguyen-chat-tieu-chuan-xuat-khau-chau-au-hilobee.jpg\" alt=\"Mật Ong Hoa Nhãn - Tiêu Chuẩn Châu Âu\" /><span style=\"font-family: Helvetica;\">\r\n</span></div>\r\n<h2><b><span style=\"color: #000000; font-family: Helvetica;\">2. Đặc điểm nhận biết mật ong hoa nhãn của Hilobee</span></b></h2>\r\n<div><span style=\"font-family: Helvetica;\">Mật ong hoa nhãn Hilobee chỉ được thu hoạch khi đã trải qua quá trình luyện đủ chín của các chú ong thợ và cho ra chất lượng mật tốt và đậm đặc nhất hoàn toàn khác biệt so với các loại mật ong khác trên thị trường hiện nay.</span></div>\r\n<div><span style=\"font-family: Helvetica;\">Hàm lượng nước trong mật ong &lt;=19% - đây là tiêu chuẩn quốc tế đủ điều kiện xuất khẩu sang các nước Châu Âu, Mỹ, Trung Đông, Nhật Bản, Hàn Quốc...</span></div>\r\n<div><span style=\"font-family: Helvetica;\">Mật ong hoa nhãn Hilobee có vị ngọt dịu và mùi hương đặc trưng của hoa nhãn. Có màu vàng sánh đặc trưng.</span></div>\r\n<div><img src=\"https://hilobee.vn/medias/uploads/0/571-mat-ong-hoa-nhan-nguyen-chat-tieu-chuan-xuat-khau-chau-au-hilobee.jpg\" alt=\"Mật Ong Hoa Nhãn - Tiêu Chuẩn Châu Âu\" /><span style=\"font-family: Helvetica;\">\r\n</span></div>\r\n<h2><b><span style=\"color: #000000; font-family: Helvetica;\">3. Công dụng của mật ong hoa nhãn Hilobee</span></b></h2>\r\n<div><span style=\"font-family: Helvetica;\">Thành phần trong mật ong hoa nhãn Hilobee có rất nhiều loại Vitamin và axit amin quan trọng như A, B1, B2, tiền tố Acid Folic... Việc sử dụng mật ong hàng ngày giúp cho chúng ta có một cơ thể khoẻ mạnh, tăng cường sức đề kháng. Giúp ăn ngon miệng, ngủ sâu giấc, có một làn da hồng hào, tươi sáng.</span></div>\r\n<div><span style=\"font-family: Helvetica;\">Ngoài ra, việc sử dụng mật ong hoa nhãn Hilobee giúp trị các loại bệnh liên quan đến đường ruột, tiêu hoá, đặc biệt là dạ dày khi kết hợp cùng với tinh bột nghệ.</span></div>','Mật Ong Hoa Nhãn loại 1 lit','Mật ong hoa nhãn Hilobee được thu hoạch trực tiếp tại các trang trại nhãn thuộc khu vực miền Bắc và miền Tây. Mật hoa nhãn khi thu hoạch phải đạt đủ độ chín. Hàm lượng nước &lt;=19% đủ tiêu chuẩn xuất khẩu sang các nước Châu Âu, Mỹ, Hàn Quốc, Nhật Bản, Trung Đông... 100% nguyên chất tự nhiên với hương vị đặc trưng của hoa nhãn','publish','open','closed','','mat-ong-hoa-nhan-tieu-chuan-chau-au','','','2019-01-15 23:55:18','2019-01-15 16:55:18','',0,'http://matong.khowebseotop.vn/?post_type=product&#038;p=201',0,'product','',1),(202,2,'2019-01-15 23:54:54','2019-01-15 16:54:54','','14709839351284-cach-nhan-biet-mat-ong-that-tranh-hang-gia-giup-ban-co-the-mua-mat-ong-nguyen-chat-1008-20160405-11042826','','inherit','open','closed','','14709839351284-cach-nhan-biet-mat-ong-that-tranh-hang-gia-giup-ban-co-the-mua-mat-ong-nguyen-chat-1008-20160405-11042826','','','2019-01-15 23:54:54','2019-01-15 16:54:54','',201,'http://matong.khowebseotop.vn/wp-content/uploads/2019/01/14709839351284-cach-nhan-biet-mat-ong-that-tranh-hang-gia-giup-ban-co-the-mua-mat-ong-nguyen-chat-1008-20160405-11042826.jpg',0,'attachment','image/jpeg',0),(233,2,'2019-01-16 00:19:04','2019-01-15 17:19:04','','banner-01','','inherit','open','closed','','banner-01','','','2019-01-16 00:19:04','2019-01-15 17:19:04','',0,'http://matong.khowebseotop.vn/wp-content/uploads/2019/01/banner-01.jpg',0,'attachment','image/jpeg',0),(234,2,'2019-01-16 00:19:06','2019-01-15 17:19:06','','banner-02','','inherit','open','closed','','banner-02','','','2019-01-16 00:19:06','2019-01-15 17:19:06','',0,'http://matong.khowebseotop.vn/wp-content/uploads/2019/01/banner-02.jpg',0,'attachment','image/jpeg',0),(235,2,'2019-01-16 00:19:07','2019-01-15 17:19:07','','banner-03','','inherit','open','closed','','banner-03','','','201