envang1.jpg',0,'attachment','image/jpeg',0),(449,2,'2019-01-16 17:30:24','2019-01-16 10:30:24','','matongsuaongchua2','','inherit','open','closed','','matongsuaongchua2','','','2019-01-16 17:30:24','2019-01-16 10:30:24','',0,'http://matong.khowebseotop.vn/wp-content/uploads/2019/01/matongsuaongchua2.jpg',0,'attachment','image/jpeg',0),(474,2,'2019-01-16 17:38:35','2019-01-16 10:38:35','','q1-2-370x110','','inherit','open','closed','','q1-2-370x110','','','2019-01-16 17:38:35','2019-01-16 10:38:35','',0,'http://matong.khowebseotop.vn/wp-content/uploads/2019/01/q1-2-370x110.png',0,'attachment','image/png',0),(476,2,'2019-01-16 17:39:27','2019-01-16 10:39:27','','q2-2-370x110','','inherit','open','closed','','q2-2-370x110','','','2019-01-16 17:39:27','2019-01-16 10:39:27','',0,'http://matong.khowebseotop.vn/wp-content/uploads/2019/01/q2-2-370x110.png',0,'attachment','image/png',0),(479,2,'2019-01-16 17:40:13','2019-01-16 10:40:13','','q3-2-370x110','','inherit','open','closed','','q3-2-370x110','','','2019-01-16 17:40:13','2019-01-16 10:40:13','',0,'http://matong.khowebseotop.vn/wp-content/uploads/2019/01/q3-2-370x110.png',0,'attachment','image/png',0),(536,2,'2019-01-16 19:07:32','2019-01-16 12:07:32','','icon','','inherit','open','closed','','icon','','','2019-01-16 19:07:32','2019-01-16 12:07:32','',0,'http://matong.khowebseotop.vn/wp-content/uploads/2019/01/icon.png',0,'attachment','image/png',0),(537,2,'2019-01-16 19:07:58','2019-01-16 12:07:58','','phone-icon','','inherit','open','closed','','phone-icon','','','2019-01-16 19:07:58','2019-01-16 12:07:58','',0,'http://matong.khowebseotop.vn/wp-content/uploads/2019/01/phone-icon.png',0,'attachment','image/png',0),(542,2,'2019-01-16 19:43:48','2019-01-16 12:43:48','Quá nghi ngại về chuyện thật – giả, người tiêu dùng quên chưa nghĩ đến rằng phẩm cấp chất lượng của các loại mật ong rất khác nhau, cũng như lựa chọn mật ong theo khẩu vị, hương vị của chúng hoàn toàn phụ thuộc vào nguồn mật hoa. Nếu cùng một nguồn mật hoa, chất lượng mật ong phụ thuộc vào độ chín của nó. Mật ong chín là loại mật hoàn thiện, có giá trị dinh dưỡng cao và ngon nhất.\r\nNếu bạn nhờ Google tìm kiếm “mật ong rừng”, nó sẽ trả về 413.000 kết quả. Tương tự, sẽ có khoảng 394.000 kết quả cho “mật ong nguyên chất”, 74.700 kết quả cho “mật ong thật”, nhưng chỉ có 10.000 kết quả cho “mật ong chín” mà thôi. Những con số đó nói lên điều gì?\r\n\r\nBà Nguyễn Phương Lan, Giám đốc công ty TNHH Zemlya, chủ sở hữu nhãn hiệu mật ong chín Honimore nhận định: “Kết quả tìm kiếm của Google những con số trên phản ánh mức độ hoài nghi của người tiêu dùng về chất lượng của mật ong. Cứ nghe nói đến mật ong, người Việt mình sẽ hỏi ngay: Có nguyên chất không? Có thật không? Có pha gì không? Có cho ong ăn đường không? Thật ra, ngoại trừ những loại mật ong không rõ nguồn gốc, mật ong có thương hiệu của các công ty, phân phối trong các siêu thị hay trung tâm mua sắm lớn đều là mật ong thật, có khác nhau thì chỉ là về chất lượng và hương vị mà thôi”.\r\n<div><img class=\"aligncenter\" src=\"http://honimore.com.vn/uploads/userfiles/image/NTD-chon-mua-mat-ong-chin-Honimore-trong-sieu-thi-2.jpg\" alt=\"\" width=\"460\" height=\"305\" />\r\nCác sản phẩm mật ong chín Honimore\r\nKết quả tìm kiếm mật ong rừng cao nhất là điều dễ hiểu vì theo logic thông thường, “rừng” bao hàm vừa thật, vừa nguyên chất và vừa không có đường. Thật ra mật ong rừng hay mật ong nuôi đều có giá trị dinh dưỡng như nhau, nếu cùng chung một nguồn mật hoa. Chất lượng các loại mật ong khác nhau phụ thuộc nhiều vào thời điểm thu hoạch mới đạt mức chất lượng cao nhất nhưng người tiêu dùng ít ai biết đến điều này.</div>\r\nVà chỉ bấy nhiêu là đủ cho chất lượng của mật ong. Điều này có đúng? Để trả lời câu hỏi này, hãy cùng tìm hiểu những kiến thức cơ bản về mật ong.\r\n\r\nMật ong là chất lỏng sánh, vị ngọt, hương thơm quyến rũ, là kết quả của việc ong hút mật hoa mang về tổ để luyện mà thành mật ong. Quá trình luyện mật gồm 2 bước. Bước thứ nhất là chuyển hóa sucrose, một loại đường phức tạp có trong mật hoa và cũng là thành phần chính của đường mía, thành glucose, một loại đường đơn giản có thể ngấm trực tiếp vào máu mà không cần thông qua hệ tiêu hóa như đường sucrose.\r\n\r\n<img class=\"aligncenter\" src=\"http://honimore.com.vn/uploads/userfiles/image/NTD-chon-mua-mat-ong-chin-Honimore-trong-sieu-thi.jpg\" alt=\"\" width=\"460\" height=\"628\" />','Chọn mua mật ong như thế nào cho đúng?','','inherit','closed','closed','','255-revision-v1','','','2019-01-16 19:43:48','2019-01-16 12:43:48','',255,'http://matong.khowebseotop.vn/255-revision-v1/',0,'revision','',0),(543,2,'2019-01-16 19:44:08','2019-01-16 12:44:08','Мật оng kết tіnh, thường đượс gọі là “lắng đường”, là một hіện tượng tự nhіên khi mật оng сhuуển từ trạng thái lỏng sang trạng thái huyền phù nổi bên trên hoặc có các hạt nhỏ lắng dưới đáy chai. Ѕаu khі đượс lấy ra khỏi tổ, mật оng сó хu hướng kết tіnh nhаnh hơn nhіều ѕо vớі khі nó ở trоng сáс bánh tổ bằng ѕáp.\r\n\r\nMật оng kết tіnh thường hay dẫn đến “hіểu lầm” сủа ngườі tіêu dùng. Мột ѕố người сhо rằng mật оng kết tіnh là dо сhất lượng hoặc điều kiện bảo quản kém hау mật ong bị рhа thêm đường. Тhựс tế hoàn toàn ngượс lạі. Nếu mật оng không kết tіnh trоng một thờі gіаn dàі, ngоạі trừ một số ít lоạі mật оng trоng đó quá trình kết tіnh tự nhіên rất сhậm, thì đó chính là mật ong đã bị рhа trộn hoặc mật non, quá loãng, còn nhiều nước.\r\n\r\nКết tіnh không làm thау đổі сhất lượng сủа mật оng. Nó сhỉ ảnh hưởng đến vẻ bên ngоàі, như màu ѕắс và hình thái. Đâу là một quá trình hоàn tоàn tự nhіên và nếu mật оng trоng nhà bếр сủа bạn đã kết tіnh, đó chính là dấu hiệu nhận biết mật оng tự nhіên tіnh khіết.','Mật ong kết tinh – biết rồi khổ lắm nói mãi','','inherit','closed','closed','','253-revision-v1','','','2019-01-16 19:44:08','2019-01-16 12:44:08','',253,'http://matong.khowebseotop.vn/253-revision-v1/',0,'revision','',0),(544,2,'2019-01-16 19:44:29','2019-01-16 12:44:29','<b>Mật ong rừng có tác dụng như thế nào với sức khỏe của bạn?</b>\r\n\r\n<strong>Mật ong rừng nguyên chất</strong> là một loại thực phẩm đa tác dụng: làm đẹp, chữa bệnh, nấu nướng…\r\n\r\nKhi kết hợp với một số thực phẩm khác sẽ tạo thành chất dược phẩm tự nhiên có tác dụng bồi bổ cơ thể và giúp chống lại bệnh tật.\r\n\r\nMột số tác dụng của mật ong:\r\n\r\nLàm đẹp: trị mụng, trắng da, trị bỏng, làm mờ rạn da, nở ngực, giảm cân…\r\n\r\nChữa bệnh: chữa dạ dày, chữa ho, bồi bổ cơ thể, tụt huyết áp, phòng chống bệnh , tăng sức đề kháng…\r\n\r\nNấu nướng: làm các món thịt nướng, bánh nướng…\r\n\r\n<b>Cách uống mật ong buổi sáng có lợi cho sức khỏe nhất</b>\r\n\r\nCách thực hiện:  ¼ quả chanh tươi + 200ml nước ấm ( 40 – 50 độ) + 2 thìa cà phê <strong>mật ong rừng</strong>.\r\n\r\nThời điểm uống mật ong vào buổi sáng tốt nhất: Sau khi vừa thức dậy bạn nên  uống dung dịch trên để đạt hiệu quả cao nhất cho sức khỏe.\r\n\r\nLưu ý:\r\n\r\n–         Không nên dùng nước pha quá nóng sẽ dẫn đến biến đổi thành phần dinh dưỡng của mật ong rừng.\r\n\r\n–         Không nên lạm dụng nước cốt chanh, pha sai liều lượng sẽ có thể khiến bạn bị viêm loét dạ dày.\r\n\r\n<b>Tác dụng của uống mật ong vào buổi sáng:</b>\r\n\r\nViệc thường xuyên uống mật ong vào buổi sáng sẽ đem lại cho bạn sức khỏe dồi dào cũng như vẻ ngoài trẻ ra cả chục tuổi. Hơn thế nữa còn giúp cơ thể phòng ngừa bệnh ung thư. Dưới đây là một số tác dụng cơ bản trong hàng trăm tác dụng của việc này:\r\n\r\n–         Rửa sạch men axit trong dạ dày, giúp hệ tiêu hóa khỏe mạnh.\r\n\r\n–         Giảm cân, tiêu mỡ thừa và duy trì vóc dáng săn chắc.\r\n\r\n–         Giúp phòng chống ung thư.\r\n\r\n–         Phòng ngừa sâu răng, cho răng chắc khỏe và trắng sáng.\r\n\r\n–         Da dẻ mịn màng, chống lão hóa.\r\n\r\nGiờ còn điều gì ngăn bạn thực hiện thói quen này hàng ngày nhỉ? Hãy tập thói quen uống mật ong vào buổi sáng luôn đi nhé.','Mật ong rừng Đà Lạt giúp bạn làm đẹp thế nào?','','inherit','closed','closed','','187-revision-v1','','','2019-01-16 19:44:29','2019-01-16 12:44:29','',187,'http://matong.khowebseotop.vn/187-revision-v1/',0,'revision','',0),(549,2,'2019-03-27 23:46:28','2019-03-27 16:46:28','[section label=\"Footer-section\" class=\"footer-section\" bg=\"156\" bg_size=\"original\" bg_overlay=\"rgba(0, 0, 0, 0.58)\"]\n\n[row style=\"small\"]\n\n[col span=\"3\" span__sm=\"6\" color=\"light\"]\n\n<h3>Về chúng tôi</h3>\n<p style=\"font-size:85%\">Giao diện website bán mật ong phù hợp với các bạn yêu thích phong cách hiện đại trẻ trung.</p>\n\n[/col]\n[col span=\"3\" span__sm=\"6\" color=\"light\"]\n\n<h3>Liên hệ</h3>\n<ul>\n<li><span style=\"font-size: 85%;\">Địa chỉ: Số 111 Dương Hiến Quyền-Hà Nội</span></li>\n<li><span style=\"font-size: 85%;\">Điện thoại: 0972123456</span></li>\n<li><span style=\"font-size: 85%;\">Email: matong@gmail.com</span></li>\n<li><span style=\"font-size: 85%;\">Website: <a href=\"https://matongnguyenchat.com/\">www.matongnguyenchat.com</a></span></li>\n</ul>\n\n[/col]\n[col span=\"3\" span__sm=\"6\" color=\"light\"]\n\n<h3>Tin tức</h3>\n[blog_posts style=\"normal\" type=\"row\" col_spacing=\"xsmall\" columns=\"1\" columns__md=\"1\" posts=\"4\" show_date=\"false\" excerpt=\"false\" comments=\"false\" image_height=\"0%\" image_width=\"0\" text_align=\"left\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"6\" color=\"light\"]\n\n<h3>FANPAGE</h3>\n<div id=\"fb-root\"></div>\n<script>(function(d, s, id) {\n  var js, fjs = d.getElementsByTagName(s)[0];\n  if (d.getElementById(id)) return;\n  js = d.createElement(s); js.id = id;\n  js.src = \"//connect.facebook.net/vi_VN/sdk.js#xfbml=1&version=v2.6&appId=1058228637573834\";\n  fjs.parentNode.insertBefore(js, fjs);\n}(document, \'script\', \'facebook-jssdk\'));</script><div class=\"fb-page\" data-href=\"https://www.facebook.com/FacebookVietnam/\" data-width=\"340\" data-hide-cover=\"false\" data-show-facepile=\"true\"></div>\n\n[/col]\n\n[/row]\n\n[/section]','Footer','','inherit','closed','closed','','284-revision-v1','','','2019-03-27 23:46:28','2019-03-27 16